import { ActionIcon } from '@mantine/core';
import { IconLayoutSidebarLeftCollapseFilled } from '@tabler/icons-react';
import ProfileMenu from './ProfileMenu';


const Header = () => {
  return (
    // flex-1 so header fills remaining space; add padding
    <div className='bg-cyan-300 w-full h-16 flex justify-between px-2 items-center py-0'>




      <ActionIcon variant="transparent"  aria-label="Settings" size="input-lg">
        <IconLayoutSidebarLeftCollapseFilled style={{ width: '100%', height: '100%' }} stroke={1.5} />
      </ActionIcon>
      <ProfileMenu />





    </div>
  );
}

export default Header;
